import React from "react";

function DriveVideoEmbed({ videoUrl, playing, onPlay, width, height}) {
    return (
        <div style={{ position: "relative" }}>
            <iframe
                src={`${videoUrl}?autoplay=${playing ? 1 : 0}`}
                style={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: width,
                    height: height,
                    border: "none",
                }}
                allow="autoplay"
                title="Google Drive Video"
                onPlay={onPlay} // Custom handler for play events
            ></iframe>
        </div>
    );
}

export default DriveVideoEmbed;
